Chaque nom d'interface doit commencer par I, le type de réponse ne génère que des données, ne génère pas de code, de msg, etc.

```ts
import request from "@/utils/request";
/** Description de l'interface - Paramètres */
export interface IApiDescParams {
  /** Nombre d'éléments par page */
  pageSize: number;
}
/** Description de l'interface - Réponse */
export interface IApiDescData {}
/** Description de l'interface - Interface */
export const methodApiDescApi = (params: IApiDescParams) => {
  return request.get<IApiDescData>("/xxx", params);
};
```
